	add("glagolitic", "{\"term\":\"glagolitic\", \"etymology\":{\"influencers\":[], \"languages\":[\"Old Church Slavonic\", \"English\", \"Serbo-Croatian\"], \"text\":\"From \u0027glagoliticus\u0027 from Serbo-croatian \u0027glagoljica\u0027 \u0027sc\u003dcyrl\u0027 from Old church slavonic \u0027глаголъ|tr\u003dglagolŭ\u0027 (word, speech) Glagolitic spelling \u0027ⰳⰾⰰⰳⱁⰾⱏ\u0027 (lang\u003dcu)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The oldest known Slavonic alphabet, designed around 862–863 by Saint Cyril in order to translate the Bible and other texts into Old Church Slavonic. Mostly replaced by Cyrillic alphabet in Orthodox Christian Slavic countries, but still in use in the Croatian Church along the Dalmatian coast, in Czech and Croatian recensions of Church Slavic\", \"priority\":1}]}, \"synonyms\":{}}");

