	add("glamour", "{\"term\":\"glamour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"scots\"], \"text\":\"From Scots \u0027glamer\u0027 from earlier Scots \u0027gramarye\u0027 (magic, enchantment, spell) The Scottish term may either be from Ancient greek (to 1453) \u0027γραμμάριον\u0027 (gram) the weight unit of ingredients used to make magic potions, or an alteration of the English word {{m|en|grammar||any sort of scholarship, especially occult learning}}.A connection has also been suggested with Old Norse {{m|non|glámr}} (poet. “moon,” name of a ghost) and {{m|non|glámsýni||glamour, illusion|lit\u003dglam-sight}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an item, motif, person, image that by association improves appearanc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Witchcraft; magic charm; a spell affecting the eye, making objects appear different from what they really are\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A kind of haze in the air, causing things to appear different from what they really are\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any artificial interest in, or association with, an object, or person, through which it or they appear delusively magnified or glorified\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Alluring beauty or charm (often with sex appeal\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"glamour\u0027\u0027 magazines; a \u0027\u0027glamour\u0027\u0027 model\", \"priority\":6}]}, \"synonyms\":{}}");

