	add("glamping", "{\"term\":\"glamping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|glamorous|camping|lang\u003den}}. Early 2006, UK origin, adopted in US by 2007.\u0026lt;ref name\u003d\u0026quot;ads\u0026quot;\u0026gt;[http://listserv.linguistlist.org/pipermail/ads-l/2007-March/068118.html \u0026quot;Glamping\u0026quot;], ads-l (The American Dialect Society), Rick Castello rick at PUNK.NET, Thu Mar 8 20:25:59 UTC 2007\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various luxury forms of camping\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, “[http://www.gadgetcandy.com/archives/2006/02/post_112.php The Glamper’s Guide To Style]” ([https://web.archive.org/web/20070814173247/http://www.gadgetcandy.com/archives/2006/02/post_112.php archive]), GadgetCandy.com, 2/24/2006:\u0026lt;ref name\u003d\u0026quot;ads\u0026quot;/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Tom Hanks and Sean Penn are doing it. Paris Hilton and Nicole Ritchie want to do it. What are we talking about? \u0027\u0027Glamping\u0027\u0027 or glamorous camping for those not yet in the know\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Jennifer Gould Keil, “[http://nypost.com/2007/02/04/are-you-a-jetrosexual-be-honest/ Are you a Jetrosexual? Be Honest…]”, \u0027New York Post,\u0027 February 4, 2007\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And \u0027\u0027glamping\u0027\u0027 – that’s luxury camping, of course\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jennifer Conlin, “[http://www.nytimes.com/2008/09/14/travel/14green-1.html Camping? Yes. Roughing It? Not Quite.]”, \u0027The New York Times,\u0027 September 14, 2008\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If the eco-friendly idea of falling asleep under the stars and roasting marshmallows around a campfire appeals to you, but the reality of pitching a tent and sleeping on bumpy ground does not, \u0027\u0027glamping\u0027\u0027, the new term being used for upscale — or glamorous — camping, could be your ideal green vacation\", \"priority\":7}]}, \"synonyms\":{}}");

